import React from 'react';
import ReactDOM from 'react-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { chevronDown } from '@fortawesome/free-solid-svg-icons'
import { Button } from 'react-bootstrap';
import 'components/UI/LoginButton/LoginButton.css';


const loginButton = (props) => (
        props.loggedIn ? <div className="loginName">Kevin Holt <FontAwesomeIcon icon={chevronDown} /></div> 
        : <Button href="http://localhost:8888" variant="nav">Login to Spotify</Button>
);

export default loginButton;
